import React from 'react';
import { Route, BrowserRouter as Router, Routes } from 'react-router-dom';
import Intro from "./components/Intro/intro";
import Cv from "./components/NavBar/navbar";
import Navbar from "./components/Resume/cv";


function App() {
  return (
    <Router>
    <div className="App">
      <Navbar />
      <Intro />
      <Routes>
          <Route path="/cv" element={Cv} />
      </Routes>
    </div>
    </Router>
  );
}

export default App;
